import MovieCard from "./MovieCard"

function Movies({ movies , isFav }) {
    return (
        <section>
            <div className="movies-container">
                {movies.map(movie => <MovieCard key={movie.id} movie={movie} isFav={true}/> )}
            </div>
            <div>
                {movies.map}
            </div>
        </section>
    )
}

export default Movies;
